import React from 'react';
import classes from './Layout.css';

const Layout = (props) => {
  return(
    <React.Fragment>
      <div>Toolbar, sidebar, backdrop</div>
      <main className={classes.Content}>
        {props.children}
      </main>
    </React.Fragment>
  );
};  

export default Layout;
